import './App.css';
import {BrowserRouter as Router,Routes,Route,Link } from "react-router-dom";
import {Home} from "./pages/Home.js"
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/createpost" element={<CreatePost />} />
      </Routes>
    </Router>
  );
}

export default App;
